import React from "react";

function Navbar() {
  return (
    <>
      <section>
        
          <li>Home</li>
          <li>Shop</li>
          <li>Blog</li>
          <li>About</li>
          <li>Contact</li>
        
      </section>
    </>
  );
}

export default Navbar;
